Už kavą nuo šiol mokėkite išmaniuoju. Prisidėkite kreditinę mokėjimo kortelę į mūsų programėlę ir:

- greitai ir patogiai atsiskaitykite už kavą ir gardėsius išmaniuoju;
- kaupkite 10% nuo kiekvienos kavos;
- matykite realų už kavą sukauptų pinigų likutį telefone;
- nusiųskite draugui kavos išmaniuoju;
- raskite greičiausią maršrutą iki artimiausios Caffeine kavinės;
- sužinokite apie artimiausius miesto renginius ir Caffeine naujienas savo telefone.

Dar neturite Caffeine kavos kortelės? Programėlėje pridėjus mokėjimo kortelę, lojalumo kortelės nr. bus sugeneruotas automatiškai.

Turite pastabų ar pasiūlymų? Lauksime Jūsų laiško adresu app@caffeine.lt.

